.modal2 {
  display: none;
  position: fixed;
  z-index: 1002;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  overflow: auto;
  background-color: rgba(0, 0, 0, 0.6);
  align-items: center;
  justify-content: center;
  display: flex;
}
.modal-content2 {
  background-color: #ffffff;
  margin: auto;
  padding: 20px;
  border: 1px solid #ccc;
  width: 80%;
  /* max-width: 600px; */
  border-radius: 5px;
  box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);
  animation-name: modalopen;
  animation-duration: 0.3s;
}
.modal-header,
.modal-footer {
  padding: 10px;
  color: #333;
  text-align: center;
  /* border-bottom: 1px solid #e5e5e5;
  border-top: 1px solid #e5e5e5;  */
}
.modal-header {
  /* border-bottom: 1px solid #e5e5e5; */
  font-size: 28px;
  text-transform: uppercase;
  letter-spacing: 1px;
}
.modal-body {
  padding: 2px 16px;
}
.modal-footer {
  /* border-top: 1px solid #e5e5e5; */
  text-align: right;
}
.close {
  color: #aaa;
  float: right;
  font-size: 28px;
  font-weight: bold;
  margin-top: -10px;
  margin-right: -10px;
}
.close:hover,
.close:focus {
  color: #555555;
  text-decoration: none;
  cursor: pointer;
}
@keyframes modalopen {
  from {
    transform: translateY(-50%) scale(0.9);
    opacity: 0;
  }
  to {
    transform: translateY(0) scale(1);
    opacity: 1;
  }
}
.modal2.show {
  display: flex;
}
.modal-footer-link:hover,
.modal-footer-link.focus {
  text-decoration: underline;
  color: blue;
}

.pagination {
  display: flex;
  justify-content: right;
  margin-top: 20px;
}
.pagination-button {
  padding: 8px 16px;
  margin: 0 4px;
  font-size: 14px;
  border: 1px solid #ccc;
  background-color: #fff;
  color: #333;
  cursor: pointer;
  transition: background-color 0.3s ease, color 0.3s ease;
}
.pagination-button:hover {
  background-color: #f0f0f0;
}
.pagination-number.active {
  color: #070707;
  border-color: #5a6268;
}
.pagination-button.active:hover {
  background-color: #0056b3;
}
.pagination-button:disabled {
  cursor: not-allowed;
  opacity: 0.6;
}
.pagination-button:disabled:hover {
  background-color: #fff;
}

.app-container {
  display: flex;
  flex-direction: column;
  align-items: center;
  font-family: Arial, sans-serif;
  background-color: #f9f9f9;
  min-height: 100vh;
  /* padding: 20px; */
  padding-top: 20px;
}
.page-content {
  /* background-color: blueviolet; */
  flex-grow: 1;
  width: 100%;
}
